import { Button, Text } from ".";

const Search = ({ label, placeholder, onChange, type, value, error }) => {
  return (
    <div className="w-full">
      <Text.label className="text-black bg-transparent">{label}</Text.label>
      {error ? <Text.sm color={"text-red"}>{error}</Text.sm> : null}
      <div>
        <input
          value={value}
          type={type || "text"}
          className="w-full bg-purpleAreatomic-500 border-1 border-blueAreatomic-500 border-solid rounded-md p-1 text-blueAreatomic-500 text-sm placeholder:text-placeholderAreatomic-500"
          placeholder={placeholder}
          onChange={(e) => onChange(e.target.value)}
        />
      </div>
    </div>
  );
};

export { Search };
